import{WorkExperienceRepository}from"../../repository/work-experience-repository.js";import{Datetime}from"../../shared/utility/datetime.min.js";class OsExperienceGraphModel{getDatabaseExperience=()=>{const e=(new WorkExperienceRepository).getAll(),o={};for(const r of e){if(!r.os||0===r.os.length)continue;if(!r.period.from||!r.period.to)continue;const e=Datetime.getNumberOfDays(r.period.from),t=Datetime.getNumberOfDays(r.period.to)-e;for(const e of r.os)o[e]||(o[e]=0),o[e]+=t}return o}}export{OsExperienceGraphModel};